import Header from './Header'

const layoutStyle = {
  margin: 20
}

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
    <style jsx global>{`
      body {
        padding: 0 16px;
      }
      .ReactGridGallery_tile-viewport:hover img {
        width: 10px;
        transform: scale(1.01);
        opacity: 0.8;
      }
    `}</style>
  </div>
)

export default Layout
